function code(){const e=new URL(window.location.href);return e.pathname.substring(e.pathname.lastIndexOf('/')+1,e.pathname.lastIndexOf('.'))}function link(){return`https://jake.harvanchik.me/case/?p=${code()}.html`}function copied(){const e=document.querySelector('button');e.classList.contains('!bg-green-600')||(e.classList.add('!bg-green-600','scale-105'),setTimeout(()=>{e.classList.remove('!bg-green-600','scale-105')},1e3))}document.title=`Case Play ${code()}`;